import React from 'react';
import './index.css';

class Header extends React.Component {
    render() {
        return (
            <main>
            <div className="container">
              <header className="header">
                <link href="#">BOLG</link>
                <div className="btn-box">
                    <button>
                      Đăng nhập
                   </button>
                  </div>
                <div className="btn-box">
                    <button>
                      Đăng nhập
                   </button>
                  </div>
              </header>
            </div>
          </main>
        )
    }
}

export default Header;
